import React from 'react';
import styled from 'styled-components';

const Div = styled.div`
    color : white;
    display: flex;
    flex-direction: row;
`

const Footer = () => {
    return (
        <Div>
            <div>Created By: 이정운</div>
            <div>제휴제안</div>
            <div>이용약관</div>
            <div>고객센터</div>
        </Div>
    );
};

export default Footer;
